    t[5176] = "CommandLine.GeneratorLoadSimpleModel.Description.Long";
    t[5177] = "The command expects three parameters:\n1. Clients input table\n2. Agents input table\n3. Ouput file name for the model file\nThe table file names can be extended by a table name\ninside the workbook file and the name of the first row to be taken\ninto accout both separated by \"!\".\nThe caller table can consist of any number of columns.\nEach column defines one client type.\nEach column has to consist of the following rows:\n- Name of the client type\n- 48 rows defining the number of calls by half-hour interval\n- Basis priority for the client type\n- Priority change per waiting second\n- Priority change on forwarding\n- Mean waiting time tolerance\n- Retry probability\n- Mean retry time\n- Any number of additional rows defining the probability of clients of this type to be forwarded after the service (in the order of the column order of the table; empty rows mean there is no forwarding to this client type)\nThe agents table can consist of any number of columns.\nEach column defines one agents group.\nEach column has to consist of the following rows:\n- Name of the agents group / the skill level\n- 48 rows for the numbers of agents per half-hour interval\n- Any number of additional rows defining the mean service times for the client types (in the order of the column order of the client types in the callers table; empty rows mean the agents group will not be able to servce clients of this type)";
