    t[9444] = "Example.Large.Description";
    t[9445] = "This is a complex example model. It consists of:\n- 8 caller groups (100,000 fresh calls per day)\n\u00a0 - Clients: Topic A, Topic B, Topic C and Topic D\n\u00a0\u00a0- Prioritized clients: Topic A, Topic B, Topic C and Topic D\n  - The prioritized clients have a higher base score and a higher score per waiting second.\n- 4 call centers with a group of agents each\n  - Call center 1: Single skill for topic A\n  - Call center 2: Single skill for topic B\n  - Call center 3: Multi skill for all topics (A+B+C+D)\n  - Call center 4: Single skill for topic A and multi skill for topics C+D\n- Because the multi skill agents will need longer for a customer, call center 1+2 will get prioritized.\n- The number of agents per interval is modeled fitting the number of fresh calls per interval.\n- The model contains forwarded calls and clients retrying after canceling due to a too long waiting time.";
